INSERT INTO `entertainments` (`id`, `user_id`, `category_id`, `event_type_id`, `title`, `year`, `rating`, `description`, `imdb_score`, `google_score`, `rt_score`, `poster_image`, `slug`, `date`, `time`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 2, 1, NULL, 'Barbie', '2023', 'Rated U/A', 'Barbie and Ken are having the time of their lives in the colorful and seemingly perfect world of Barbie Land. However, when they get a chance to go to the real world, they soon discover the joys and perils of living among humans.', '6.2', '1.2', '1.3', 'public/uploads/poster_images/Z53DAF2E6iaAKK4HhG0034xgIbCAlmtXSVRjaXTl.png', 'barbie', NULL, NULL, 1, '2024-03-11 15:15:12', '2024-03-11 16:19:49', NULL),
(2, 2, 1, NULL, 'Oppenheimer', '2023', 'Rated S', 'Oppenheimer is a 2023 epic biographical thriller film[a] written, directed, and produced by Christopher Nolan', '7', '6', '5.5', 'public/uploads/poster_images/zo2GWwL75SQ9CU6ypdv68U8InlOjJRN6Ee4WXjxK.jpg', 'oppenheimer', NULL, NULL, 1, '2024-03-11 17:14:15', '2024-03-11 17:14:15', NULL),
(3, 2, 1, NULL, 'Freedom Writers', '2007', 'Choose Rated', 'Freedom Writers is a 2007 American drama film written and directed by Richard LaGravenese.\r\nIt is based on the 1999 book The Freedom Writers Diary by teacher Erin Gruwell and students who compiled the book out of real diary entries about their lives that they wrote in their English class at Woodrow Wilson Classical High School in Long Beach, California.', '7.6', '6.5', '7', 'public/uploads/poster_images/olgRlD91gulaW9IVH9JSKihtjCKkmAsQ4EmGLv6w.jpg', 'freedom-writers', NULL, NULL, 1, '2024-03-11 17:19:41', '2024-03-11 17:19:41', NULL),
(4, 2, 1, NULL, 'Life of Pi', '2012', 'Rated A', 'A great story about a man named Pi whose family owns a zoo. His father decides they will move to Canada and will sell the animals there. A terrible storm sinks the ship and Pi finds himself in a lifeboat with a zebra, an orangutan, a hyena, and a tiger. Eventually, it’s just Pi and the tiger after the hyena kills the zebra, and the orangutan and the tiger kill the hyena. When he is rescued he tells this story but nobody believes him. And then, a twist.', '9', '7', '8', 'public/uploads/poster_images/oq7jM1VdXYZS7av9phggzWk9rQavA8JQn7g7HaXM.jpg', 'life-of-pi', NULL, NULL, 1, '2024-03-11 17:26:18', '2024-03-11 17:26:18', NULL),
(5, 2, 1, NULL, 'Like Stars on Earth', '2007', 'Rated S', 'An eight-year-old boy is thought to be a lazy trouble-maker, until the new art teacher has the patience and compassion to discover the real problem behind his struggles in school.', '8.3', '6', '7', 'public/uploads/poster_images/oYjKurqkZEkk70j8QZo8lhYu4I6Ag8bdBNfxpi9Y.jpg', 'like-stars-on-earth', NULL, NULL, 1, '2024-03-11 17:35:40', '2024-03-11 17:35:40', NULL),
(6, 2, 2, NULL, 'The Last Airbender', '2023', 'Rated A', 'The Last Airbender, an American animated television series created by Michael Dante DiMartino and Bryan Konietzko and produced by Nickelodeon Animation Studio. The first season aired on Nickelodeon from February 21 to December 2, 2005, and consisted of 20 episodes.', '8', '6', '7', 'public/uploads/shows/poster_images/x1fwUYhURGFSlJJTPNxgNHraecWcoSqOfoEB2tMW.jpg', 'the-last-airbender', NULL, NULL, 1, '2024-03-11 19:59:38', '2024-03-11 19:59:38', NULL),
(7, 2, 2, NULL, 'Dark Winds', '2022', 'Rated S', 'Dark Winds is an American psychological thriller television series created by Graham Roland based on the Leaphorn & Chee novel series by Tony Hillerman.', '7.7', '6', '10', 'public/uploads/shows/poster_images/LxGgYtqSPvM1udIpiUnEZkeDEakFNHqWXj6m30wd.jpg', 'dark-winds', NULL, NULL, 1, '2024-03-11 20:05:33', '2024-03-11 20:05:33', NULL),
